import React from "react";
import { useNavigate } from "react-router-dom";

const Artist = ({artist}) =>{
    const navigate = useNavigate();
    const editArtist = (a, uuid) => {
        a.preventDefault();
        navigate(`/updateArtist`)
    }
    const deleteArtist = (a, uuid) => {
        a.preventDefault();
        navigate(`/deleteArtist/${uuid}`)
    }
    return (
        <tr key = {artist.uuid}>
            <td>
                <div>{artist.name}</div>
            </td>
            <td>
                <div>{String(artist.active)}</div>
            </td>
            <td width={75}>
                <a
                    onClick={(a, uuid) => editArtist(a, artist.uuid)}>
                    Edit
                </a>
            </td> 
            <td width={75}>
                <a
                    onClick={(a, uuid) => deleteArtist(a, artist.uuid)}>
                    Delete
                </a>
            </td> 
        </tr>
    );
};

export default Artist;
